import React from 'react';

export const DailyWeather = (props) => {
  const forACast = props.forecast;
  console.log(forACast);
  const weatherForAWeek = forACast.map((product, i, arr) => {
    console.log(product, i, arr);
    return `<h1>$(product.date)</h1>`;
  });
  console.log(weatherForAWeek);
  return null;
};
